import './App.css';
import React, { useState } from 'react';
import Navbar from './Navbar';
import house from './housing.jpeg';
import Card from './Card';

function App() {
  const [selectedFeature, setFeature] = useState();

  const handleCardSelect = (id) => {
    setFeature(id);
  };

  return (
    <div className="App">
      <Navbar />
      <div className='imageContainer'>
        <img src={house} alt='Housing image here' className='housingImage'/>
        <div className='textOverlay'>MEET YOUR SENIORS<br></br>FIND HOUSING<br></br>AND MORE!</div>
      </div>
      <Card
        id={1}
        image="https://via.placeholder.com/600x400"
        heading="Card 1"
        text="This is some example text for the first card."
        onSelect={handleCardSelect}
      />
      <Card
        id={2}
        image="https://via.placeholder.com/600x400"
        heading="Card 2"
        text="This is some example text for the second card."
        onSelect={handleCardSelect}
      />
      <Card
        id={3}
        image="https://via.placeholder.com/600x400"
        heading="Card 3"
        text="This is some example text for the third card."
        onSelect={handleCardSelect}
      />
      {selectedCard !== null && <p>Selected Card ID: {selectedCard}</p>}
    </div>
  );
}

export default App;
